import React,{useState} from 'react';
import { TouchableOpacity } from 'react-native-web';
import { NativeBaseProvider, Text, Box , extendTheme, Button} from 'native-base';
import InputButton from './src/components/inputButton';


const buttons =  [
  ['CLEAR', 'DEL'],
  ["7", "8" ,"9", '/'],
  ["4", "5", "6", "x"],
  ["1", "2", "3", "-"],
  ["0", ".", "=", "+"]
];

export default function App() {
  return (
    <NativeBaseProvider>
      {buttons.map((buttonRows)=>{
        let rowItems = buttonRows.map((buttonitem, idx)=>(
          <TouchableOpacity onPress={()=> handleInput(Item)} key={idx}>
            <Text>{Item}</Text>
          </TouchableOpacity>
        ))
        return <>{rowItems} <br/></>
      }
      )}
    </NativeBaseProvider>
  );
}
